import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from "../Home/Home";
import Uzytkownicy from "../Uzytkownicy/Uzytkownicy";
import PrivateRoute from '../PrivateRoute/PrivateRoute'; // Upewnij się, że PrivateRoute jest zaimportowany
import logo from './img/logo.png';
import Search from "./Search/Search";
import LogoutX from "../logout/logout";

function MainWindow({ handleLogout, serverMessage, user, role }) {
  return (
    user && (
      <Router>
        <LogoutX onLogout={handleLogout} />
        <div className="MainWindow">
          <div className="alert">{serverMessage && <div>{serverMessage}</div>}</div>
          <div className="COL1">
            <div className="A1 LOGO">
              <Link to="/Home">
                <img className="logo-img" src={logo} alt="Logo" />
              </Link>
            </div>
            <div className="B1">
              <Search></Search>
            </div>
          </div>
          <div className="COL2">
            <div className="A2">
              <div className="MENU">
                {role === 'admin' && <Link to="/Uzytkownicy">Użytkownicy</Link>}
                <Link to="/Rachunki">Rachunki</Link>
                <Link to="/Finanse">Finanse</Link>
              </div>
            </div>
            <div className="B2 OKNO">
              <div id="content">
                <Switch>  {/* Użyj komponentu Switch */}
                  <Route path="/" component={Home} exact /> {/* Główna ścieżka */}
                  <PrivateRoute path="/Uzytkownicy" component={Uzytkownicy} role={role} /> {/* Ścieżka chroniona */}
                  {/* Możesz dodać więcej chronionych ścieżek */}
                </Switch>
              </div>
            </div>
          </div>
        </div>
      </Router>
    )
  );
}

export default MainWindow;
